import React from "react";
import { Nav, Navbar } from "rsuite";

const BottomNav = () => {
  const navBarStyles = {
    display: "flex",
    position: "absolute",
    bottom: 0,
    width: "100%",
  };
  return (
      <Navbar className={"unstyledList"} style={navBarStyles}>
        <Nav>
          <Nav.Item>

              + Project

          </Nav.Item>
          <Nav.Item>

              + Code Snippet

          </Nav.Item>
        </Nav>
        <Nav pullRight>
        <Nav.Item>
          <button
            className="primaryButton"
            sytle={{
              width: "6rem",
            }}
          >
            Settings
          </button>
        </Nav.Item>
        </Nav>
      </Navbar>
  );
};

export default BottomNav;
